import React from "react";
import "./card.css";

function Card({
    style={},
    classNames="",
    children,
    headerComponent,
    footerComponent
}) {
    return (
        <div class="card">
            {
                headerComponent &&
                <div class="card-header">
                    {headerComponent}
                </div>
            }
            <div class="card-main">
                {
                    children
                }
            </div>
            {
                footerComponent && 
                <div class="card-footer">
                    {footerComponent}
                </div>
            }
      </div>
    )
}

export default Card;
